(1, 'Industrial Craft 2', 'Модификация для одиночной игры и режима мультиплеер на серверах Minecraft. Модификация добавляет в мир Minecraft промышленное производство (металлургия, электротехника, агропромышленность), благодаря появлению различных видов энергии, новым устройствам и инструментам.', 'Exretimental: #823'),
(2, 'BuildCraft', 'Модификация , упрощающая добычу ресурсов и постройку, а также транспортировку и распределение жидкостей и не только.', '7.1.16'),
(3, 'Forestry', 'Модификация, специально разработанная для использования с BuildCraft и IndustrialCraft 2. Включает в себя:  автоматическая ферма деревьев, пшеницы, адского нароста, кактусов, сахарного тростника, тыкв и арбузов, дополнительные энергетические ресурсы для BuildCraft и IndustrialCraft, а так же пчеловодство', '4.2.12.62');

