INSERT INTO `News` (`Id`, `Title`, `Text`, `TimeCreate`, `Image`, `ViewersCount`, `Author`) VALUES
(1, 'Открытие проекта очень скоро!', '[p]Всем привет, дорогие друзья! Скоро, очень скоро проект HitechCraft будет наконец открыт. Готовим мы вам не только стандартные старинные плюшки, которые у нас были до этого, но и новинки.[/p][p]Ну и начнем мы с оборудования. У нас приобретена на первое время бюджетная машина под сервера, нагрузка которой примерно выдерживает 3 - 4 фуловых сервера Minecraft. Фуловых (полных) я имею ввиду по 100 человек, уж не будем нарушать традиции!) Работа машины - 24/7, без крашей, ошибок и вылетов.[/p][p]Новое самописное программное обеспечение работает без отлагательств, без ошибок и 24/7. Если и будут какие-то ошибки, то из-за небольшой невнимательности Разработчиков. Нашли таковые? Пишем сюда - [b]support@hitechcraft.ru[/b], объясняем ошибку, получаем небольшие поощрения за найденный баг!)[/p][p]А что у нас по серверам??? Да все отлично! Возвращается старый добрый IC2 сервер - Industrial Extentions, новый сервер Parallel Worlds (магический), ну а по остальным немного позже. Не портить же вам сюрприз... [/p][p]Пройдемся по программному обеспечению. На сайте много плюшек, которые вам позволят украсить время провождение на проекте:[ul][li]Удобненько все расположили (в плане дизайна). Трудились много, чтобы вам было удобно![/li][li]Ну [b]Магазин ресурсов[/b] вы все помните. За игровую валюту вы можете приобрести еще больше ресурсов! Накопали земли - купили солнечную панель. Удобно же!)[/li][li][b]Форум[/b] пока что не доступен, но ничего! Задать вопросы и что-то предложить вы пока можете нам на почту - [b]support@hitechcraft.ru[/b]! Интересные идеи, естественно, поощряются!)[/li][li][b]Сервисов[/b] тоже пруд пруди... Топ игроков, бан-лист и др. Все это необходимо, а за топ мы вообще призы ежемесечно даем![/li][/ul][/p][p]Все о сайте, да о сайте. А по лаунчеру у нас тоже все круто, дизайн так же взяли минималистичный, глаз не режет и юзать удобно:[ul][li]Красиво оформленно. Как уже сказал - дизайн [b]минималистичен[/b]. Ничего лишнего.[/li][li]Безопасность на высшем уровне! Все данные [b]кэшируется[/b], что позволяет их обезопасить от третьих лиц.[/li][li]Вирусов нет (проверено [b]Dr. Web[/b]). [/li][/ul][/p][p]На клиенты и сервера тоже времени было убито много. Подобраны качественные модификации под каждый вид сервера. Спавны старались строить свои, а там, где они "не наши" красиво оформили, а не просто взяли и вставили...[/p][p]Ну а вот что я хотел вам сказать по поводу открытия! Надеюсь вам понравилось. Ждем вас на проекте HitechCraft![/p]', '2016-07-25 15:09:50', , 22, 'Random');

